import { useState } from 'react';
import './App.css';

function App() {
  const [count, setCount] = useState(0);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to My React App</h1>
        <button onClick={() => setCount(count + 1)}>
          Count is: {count}
        </button>
      </header>
    </div>
  );
}

export default App;
